import React from "react";
import { useNavigate } from "react-router-dom";

function ConfirmMessage() {
  const navigate = useNavigate();

  return (
    <div className="container d-flex flex-direction-column justify-content-center align-items-stretch">
      <div class="card">
        <h5 class="card-header">Confirmation of sending the message</h5>
        <div class="card-body">
          <p class="card-text">Your message has been sent successfully</p>
          <button onClick={() => navigate("/")}>Main page</button>
          <button onClick={() => navigate("/contact")}>Contact</button>
        </div>
      </div>
    </div>
  );
}

export default ConfirmMessage;
